133:
SELECT ?item WHERE {
  ?item wdt:P20 wd:Q42 ; 
         wdt:P45 ?award .
  FILTER(?award = wd:Q7398) .
  BIND (IF(HAS_QUALIFIER(?item,wd:Q12193,"Europe"), "yes","no") AS ?answer)
  FILTER(?answer="yes")
}

134:
SELECT ?item ?itemLabel WHERE {
  ?item wdt:P170 wd:Q35 .
  ?item wdt:P19 wd:Q38 .
  SERVICE wikibase:label { bd service label }
}
